    Component
} from 'react'
import axios from 'axios';

class Data extends Component {


    constructor(props) {
        super(props);
        this.state = {
            imageURL: '',
        }
    }

    componentDidMount() {
        axios.get('https://dog.ceo/api/breeds/image/random')
            .then(response => {
                console.log(response.data);
            })
            .catch(error => {
                console.log(error);
            });
    }


    render() {
